function LoginPage() {

    return(
        <form>
            <div className="form-inner">
                <h2>Login</h2>
                <div className="login-form-group">
                    <input type="submit" className = "google-login-button" value="Login with google" />
                </div>
            </div>
        </form>
    )
}

export default LoginPage
